"use strict";let t="https://explorer-api.walletconnect.com";exports.WalletConnectClient=class{async fetchListings(){let e=new URL("v3/wallets",t);e.searchParams.append("projectId",this.projectId);let l=await fetch(e);if(!l.ok)return console.debug(`Failed to fetch WalletConnect listings: ${await l.text()}`),{listings:[],total:0};let s=await l.json(),a=Object.values(s.listings);return{listings:[a.find((t=>"io.metamask"===t.rdns)),a.find((t=>"me.rainbow"===t.rdns)),...a.filter((t=>!["io.metamask","me.rainbow"].includes(t.rdns)))].filter((t=>!!t)),total:s.total}}getWalletImageUrl(e){return`${t}/w3m/v1/getWalletImage/${e}?projectId=${this.projectId}`}constructor(t){this.projectId=t}};
